INSERT INTO `tbl_themes` VALUES ('123456','		\r\n		.dmx {\r\n    font: 11px tahoma;\r\n	float:left;\r\n}\r\n\r\n.dmx .item1,.dmx .item1-active{\r\n\r\n\r\n	text-align:center;\r\n	color:#FFFFFF;\r\n	border:1px solid #FFFFFF;\r\n    text-decoration: none;\r\n	padding:10px;\r\n	border-radius:5px;\r\n	height:40px;\r\n	line-height:40px;\r\n    white-space: nowrap;\r\n    position: relative;\r\n\r\n}\r\n\r\n\r\n.dmx .item2,\r\n.dmx .item2:hover,\r\n.dmx .item2-active,\r\n.dmx .item2-active:hover{\r\npadding:7px;\r\n    font: 10px tahoma;\r\n    font-weight: bold;\r\n	text-decoration:none;\r\n    display: block;\r\n    white-space: nowrap;\r\n    position: relative;\r\n    z-index: 500;\r\n	color:#003300;\r\n}\r\n\r\n.dmx .item2:hover{\r\nbackground-color:#003300;\r\ncolor:#FFFFFF;\r\n}\r\n\r\n\r\n.dmx .item2:hover,\r\n.dmx .item2-active,\r\n.dmx .item2-active:hover {\r\n\r\n}\r\n.dmx .arrow,\r\n.dmx .arrow:hover {\r\n    padding: 3px 16px 4px 8px;\r\n}\r\n.dmx .item2 img,\r\n.dmx .item2-active img{\r\n    position: absolute;\r\n    top: 4px;\r\n    right: 1px;\r\n    border: 0;\r\n}\r\n.dmx .section{\r\nbackground-color:#FFFFFF;\r\nwidth:180px;\r\n    position: absolute;\r\n    visibility: hidden;\r\n    z-index: -1;\r\n	box-shadow:1px 1px 1px #006600;\r\n}\r\ndiv.content\r\n{\r\nbackground-color:#FFFFFF;\r\nfloat:left;\r\nwidth:773px;\r\npadding-bottom:20px;\r\n\r\n\r\n}\r\n\r\ndiv.contents_{\r\nfont-size:18px;}\r\n\r\n\r\n/*heading*/\r\ndiv.heading\r\n{\r\npadding-top:25px;\r\npadding-bottom:25px;\r\npadding-right:50px;\r\npadding-left:50px;\r\n\r\nbackground: #ECF1EF;\r\nmargin:0px;\r\n  font: 20px arial;\r\n    color: #000000;\r\n    font-weight: bold;\r\n    position: relative;\r\n    display: block;\r\n    white-space: nowrap;\r\n}\r\n\r\ndiv.loguser\r\n{\r\npadding-top:12.5px;\r\npadding-bottom:12.5px;\r\npadding-right:25px;\r\npadding-left:25px;\r\n/*padding:5px;*/\r\nbackground: #ECF1EF;\r\nmargin:0px;\r\n  font: 10px arial;\r\n    color: #000000;\r\n    font-wei