BEGIN

 SET @mSql = CONCAT('select AccountDesc_tx, sum(amount) as amount from (select CONCAT(''CS'',hdr.CSID_cd) as control,hdr.CSDate_dt as mDate,hdr.Particular_tx, m.AccountDesc_tx, dtl.CreditAmount_no as amount from tb_tcashsaleshdr as hdr
